import './blog.css';
import React from 'react'

// import {blog01,blog02,blog03,blog04,blog05} from "./imports"
export const Blog = ({passedArticle}) => {
  return (
    <>
      <div className="gpt3_blog section_padding" id="blog">
        <div className="gpt3_blog-heading">
          <h1 className="gradient_text">A Lot is Happening <br />We are Blogging about it</h1>
        </div>
      </div>
    {
    passedArticle.map((newArt)=>{
      const {id,image,heading,text}=newArt;
    return (
      <>
       <div layout className="card-container" key={id}>
            <div className="card">
                <div className="card-body">
                    <span className="card-number">
                        {id}
                    </span>
                    <h5 className="card-title">{heading}</h5>
                    <span className="card-description subtle">
                        {text}
                    </span>
                    <div className="card-read">Read</div>
                </div>
            <img src={image} alt="blog_post-image" className="card-media" />
            <span className="card-tag subtle">Order</span>
            </div>
       </div> 
      </>
    );
        
        })}
    </>
 )
      }
